import React from 'react';
import './App.css';

const App = () => {
  return (
    <div>
      <Header />
      <Technologies />
    </div>
  );
}

const Technologies = () => {
  return (
    <ul>
      <li>css</li>
      <li>html</li>
      <li>js</li>
      <li>react</li>
    </ul>
  );
}

const Header = () => {
  return (
    <div>
      <a href="#">Home</a>
      <a href="#">News feed</a>
      <a href="#">Message</a>
    </div>
  );
}

export default App;
